result:
query {

  executives: allContentfulLeader (sortBy:"lastname", order:ASC, filter:{team:{eq:"executive"}, position:{eq:"Executive"}}) {
    edges {
      node {
        id
      	name
        firstname
        lastname
        slug
        jobTitle
        image {
          description
          file {
            url
          }
        }
    	}
  	}
  },

  leaders: allContentfulLeader (sortBy:"lastname", order:ASC, filter:{team:{eq:"executive"}, position:{ne:"Executive"}}){
    edges {
      node {
        id
      	name
        firstname
        lastname
        slug
        jobTitle
        image {
          description
          file {
            url
          }
        }
    	}
  	}
	},

  boardPosts:allContentfulLeader(sortBy:"lastname", order:ASC, filter:{team:{eq:"board"}}) {
    edges {
      node {
        id
      	name
        slug
        jobTitle
        image {
          description
          file {
            url
          }
        }
    	}
  	}
	}
}
